class Card extends Component {

  render() {
  	const props = this.props;
    return (
      <div className={`card_item_wrapper ${props.gird}`}>
      	<div 
      	 className='image'
      	 style={{
      	 	background:`url(${this.rendCardImage(props.images)}) no-repeat`
      	 }}

      	>
      	</div>
      </div>
    )
  }
}

export default Card
